import { allActivityStatus } from '@/utils/const'
export default {
  props: {
    status: {
      type: String,
      default: ''
    }
  },
  methods: {
    parseText(value) {
      const result = allActivityStatus.find(item => item.value === value)
      return result && result.label || '--'
    }
  }
}
